import Layout from '../components/Layout';
import { Container,  Row, Col, Form} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


export default () => (
    <Layout title="Personal Settings page." >
        <div class="children-box">
        <Container>
            <Row>
                <Col><Form.Label column lg={3}>Normal Text</Form.Label></Col>
            </Row>
            <Row>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
            </Row>
        </Container>
        </div>
    </Layout>
);
